import styled from 'styled-components';
import IntervalsCountDisplay from './IntervalsCountDisplay';

const TopHalf = styled.div`
background: transparent;
border-bottom: 2px solid black;
margin: 13px -5px;
position: absolute;
left: 0px;
width: 90%;
height: 200px;
`

const TopHalfLeft = styled.div`
position: absolute;
width: 30%;
left: 0%;
height: 100%;
bottom: 0%;
border-right: 2px solid black;
`
const Label = styled.h1`
font-size: 175%;
text-align: center;
font-weight: normal;
`
const IntervalPerRideCount = styled.div`
height: 100;
padding-left: 2%;
padding-right: 2%;
border-top: 2px solid black;
`

const AttractionIntervals = () => {
    return (
        <TopHalf>
            <TopHalfLeft>
                <Label> Attraction Intervals </Label>
                <IntervalPerRideCount>
                    <IntervalsCountDisplay></IntervalsCountDisplay>
                </IntervalPerRideCount>
            </TopHalfLeft>

        </TopHalf>
    )
}

export default AttractionIntervals
